import React,{useEffect} from 'react'
import M from "materialize-css/dist/js/materialize.min.js";


const SideNav = () => {


    // const handleOpenNav = () => {
    //     let sidenav = document.querySelector("#slide-out");
    //     M.Sidenav.init(sidenav, {});
    //     console.log('sidenav clicke')
    // }

    const handleCloseNav=()=>{
        let sidenav = document.querySelector("#slide-out");
        var instance = M.Sidenav.getInstance(sidenav)
        instance.close();
    }

    return (
        <>
         <a href="#!" data-target="slide-out" className="sidenav-trigger"><i className="material-icons medium">menu</i></a>

        <ul id="slide-out" className="sidenav">
        <a href="#!" data-target="slide-out" onClick={()=>{M.Sidenav.G}}><i className="material-icons waves-effect medium">close</i></a>


        <li><a href='#!' className="subheader">Logs Section</a></li>

          <li><a href="#!">Completed logs</a></li>
          <li><a href="#!">Uncompleted logs</a></li>

          <li><div className="divider"></div></li>
          <li><a href='#!' className="subheader">Techs Section</a></li>
          <li><a className="waves-effect" href="#!">Team</a></li>
        </ul>

      </>
    )
}

export default SideNav;
